    def elbow_wrist(self, theta):
        return np.concatenate((self.jacob_elbow(theta), self.jacob_wrist(theta)), axis=0)

    def finger_tips(self, theta):
        return np.concatenate((self.jacob_thumb(theta), self.jacob_index(theta), self.jacob_middle(theta)), axis=0)

